import AddButton from "../../01-atoms/buttons/add-button/AddButton";
import BudgetItem from "../../02-molecules/BudgetItem/BudgetItem";

function BudgetMenager() {
  const budgetDummyData = [
    {
      id: "e1",
      title: "Jedzenie",
      money: "1800",
    },
    {id: "e2", title: "Dom", money: "2400",},
    {
      id: "e3",
      title: "Ubrania",
      money: "800",
    },
    {
      id: "e4",
      title: "Samochód",
      money: "800",
    },
    {
      id: "e5",
      title: "Podróże",
      money: "900",
    },
    {
      id: "e6",
      title: "Inne",
      money: "1000",
    },
  ];
  return (
    <section className="budget-container">
      <header className="budget-container--header">
        <h2 className="budget-container--title">Budget Menager</h2>

        <AddButton>Add Budget</AddButton>
      </header>

      <BudgetItem title={budgetDummyData[0].title} money={budgetDummyData[0].money}/>
      <BudgetItem title={budgetDummyData[1].title} money={budgetDummyData[1].money}/>
      <BudgetItem title={budgetDummyData[2].title} money={budgetDummyData[2].money}/>
      <BudgetItem title={budgetDummyData[3].title} money={budgetDummyData[3].money}/>
      <BudgetItem title={budgetDummyData[4].title} money={budgetDummyData[4].money}/>
      <BudgetItem title={budgetDummyData[5].title} money={budgetDummyData[5].money}/>
    </section>
  );
}
export default BudgetMenager;
